import ThemeChanger from "./components/ThemeChanger";

const App = () => {
  return (
    <div>
      <ThemeChanger/>
      <header>
        <a href="#">logo</a>
        <ul>
          <li><a href="#">home</a></li>
          <li><a href="#">work</a></li>
          <li><a href="#">contact</a></li>
        </ul>
      </header>
    </div>
  );
}

export default App;
